import React from "react";
import { Link, useNavigate } from "react-router-dom";

const Signup = () => {
  const navigate = useNavigate();

  const handleSignup = (e) => {
    e.preventDefault();
    navigate("/"); // Navigate to login after signup
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient-to-br from-blue-900 to-purple-700">
      <div className="bg-white p-10 rounded-lg shadow-xl max-w-md w-full">
        <h2 className="text-3xl font-bold text-center text-gray-900">Create a new account</h2>
        <p className="text-center text-gray-500 mb-6">
          Already have an account? <Link to="/" className="text-indigo-500 font-semibold hover:underline">Sign in here</Link>
        </p>
        <form className="space-y-5" onSubmit={handleSignup}>
          <div>
            <label className="block text-gray-700 font-medium">Full Name</label>
            <input type="text" className="w-full p-3 border border-gray-300 rounded-lg bg-gray-100 focus:outline-none focus:ring-2 focus:ring-indigo-500" required />
          </div>
          <div>
            <label className="block text-gray-700 font-medium">Email</label>
            <input type="email" className="w-full p-3 border border-gray-300 rounded-lg bg-gray-100 focus:outline-none focus:ring-2 focus:ring-indigo-500" required />
          </div>
          <div>
            <label className="block text-gray-700 font-medium">Password</label>
            <input type="password" className="w-full p-3 border border-gray-300 rounded-lg bg-gray-100 focus:outline-none focus:ring-2 focus:ring-indigo-500" required />
          </div>
          <button type="submit" className="w-full bg-indigo-600 hover:bg-indigo-700 text-white py-3 rounded-lg font-bold transition">
            Create Account
          </button>
        </form>
        <p className="mt-4 text-center text-gray-600">
          Already have an account? <Link to="/" className="text-indigo-500 hover:underline">Login</Link>
        </p>
      </div>
    </div>
  );
};

export default Signup;
